import React from 'react';
import { deleteBuilding } from '../services/api';

interface Building {
  id: number;
  name: string;
  temperature: number;
  location?: string;
  status?: string;
}

interface BuildingListProps {
  buildings: Building[];
}

const BuildingList: React.FC<BuildingListProps> = ({ buildings }) => {
  const handleDelete = async (id: number) => {
    await deleteBuilding(id);
    // Here, handle deletion if needed, or let App.tsx refresh the list
  };

  return (
    <div>
      <h2>Buildings</h2>
      <ul>
        {buildings.map((building) => (
          <li key={building.id}>
            <h3>{building.name}</h3>
            <p>Temperature: {building.temperature}Â°C</p>
            <button onClick={() => handleDelete(building.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BuildingList;
